import {Routes, Route} from "react-router-dom";
import Layout from './layout';

function Router () {

    return (


            <Routes>
                <Route path={"/"} element={<Layout/>}>
                    <Route path={"members/new"}/>
                    <Route path={"members"}/>
                    <Route path={"items/new"}/>
                    <Route path={"items"}/>
                    <Route path={"order"}/>
                    <Route path={"orders"}/>
                </Route>
            </Routes>
    )



}





export default Router;
